import React from 'react'
import {useForm}  from 'react-hook-form'
import { useNavigate } from 'react-router-dom';


export default function Login() {

    const {register, handleSubmit , formState:{errors}} = useForm(); 
    const navigate = useNavigate();

    const onSubmit = (data)=>{
        console.log("submitted data , ", data);
        navigate('user');
    };

    const resetPassword = ()=>{
        console.log("Resetting Password ");
        navigate('resetPassword');
    };


  return (
    <form onSubmit={handleSubmit(onSubmit)} style={{textAlign:'center', border:'solid', width:300, minHeight:300}}>
      
        <h2>Welcome to TilesKart</h2>
        
        <label style={{width:80, float:'left'}}>Username  </label>
        <input {...register("userName", {required:true})}></input>
        {/* {error.name && <h6 style={{color:'red'}}>{error.name}</h6>} */}
        <br/><br/>

        <label style={{width:80, float:'left'}}>Password  </label>
        <input type='password' {...register("password", {required:true})}></input>
        {/* {error.name && <h6 style={{color:'red'}}>{error.name}</h6>} */}
        <br/><br/>
        <button type='submit'>Login</button>

        <button onClick={resetPassword}>Reset Password</button>
        <br/><br/>
    </form>
  )
}
